import { useState, useEffect } from 'react';

const Results = (
  results = null,
  recordingDateTime = null
) => {

  if (!results) {
    return null;
  }

  return (
    <div className="results-container">
      <h2>Analysis Results</h2>
      <div className="results-grid">
        <div>
          <h3>Mean Heart Rate</h3>
          <p>{results.mean} bpm</p>
        </div>
        <div>
          <h3>Minimum Heart Rate</h3>
          <p>{results.min_hr} bpm at {new Date(results.min_time).toLocaleString()} ms</p>
        </div>
        <div>
          <h3>Maximum Heart Rate</h3>
          <p>{results.max_hr} bpm at {results.max_time} ms</p>
        </div>
      </div>
    </div>
  );
};

export default Results;
